import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Menu, LogOut } from "lucide-react";
import { useNavigate } from "react-router-dom";

const UserNavbar = ({ onMenuClick }) => {
  const navigate = useNavigate();

  return (
    <header
      className="border-bottom shadow-sm py-2 px-3 fixed-top"
      style={{
        background: "linear-gradient(90deg, hsl(215,25%,12%), hsl(215,25%,10%))",
        zIndex: 1055,
      }}
    >
      <div className="d-flex align-items-center justify-content-between">
        <div className="d-flex align-items-center gap-2">
          <button
            className="btn btn-outline-secondary d-lg-none p-2"
            onClick={onMenuClick}
            style={{
              backgroundColor: "hsl(215,25%,14%)",
              borderColor: "hsl(215,20%,25%)",
              color: "hsl(210,40%,98%)",
            }}
            title="Toggle sidebar"
          >
            <Menu size={18} />
          </button>

          <div className="d-flex align-items-center gap-2">
            <img src="/GTLogos.png" alt="Logo" style={{ height: 48, borderRadius: 6 }} />
            <div className="d-none d-sm-block">
              <h6 className="mb-0 text-light">Gandeevan Technologies</h6>
            </div>
          </div>
        </div>

        <div className="d-flex align-items-center gap-2">
          <div className="text-end d-none d-md-block">
            <div className="fw-semibold">User A</div>
            <small className="text-muted">user@gmail.com</small>
          </div>

          <div
            className="rounded-circle bg-info text-white d-flex justify-content-center align-items-center fw-bold"
            style={{ width: 40, height: 40 }}
          >
            UA
          </div>

          <button
            className="btn btn-outline-danger p-2"
            onClick={() => navigate("/login")}
            title="Logout"
            style={{ borderColor: "hsl(0,72%,51%)", color: "hsl(0,72%,51%)" }}
          >
            <LogOut size={16} />
          </button>
        </div>
      </div>
    </header>
  );
};

export default UserNavbar;
